/*****************************************************************************
Description: This procedure "ends" a job history record based on the job name and job history ID passed in. It also updates the end time, status, max update date, max ID, and row count based on the values passed in.
NOTE: pi_status = 'C' should be passed in if the job completed successfully so that the next invocation of start_job will pick up the most recent date and ID values.
Revision History Date Who Description --------------------------------------------------------------------------- 2021-03-25 Daniel Silva Intital Deployment
