BEGIN
DECLARE @fileName VARCHAR(MAX), @BulkInsSQL NVARCHAR(MAX), @hasDataToLoad int;
BEGIN TRY
CREATE TABLE #Json ( jsonData NVARCHAR(MAX) )
CREATE TABLE #LegalSummaryOfChanges (TableName VARCHAR(MAX), Deleted VARCHAR(MAX), ActionType VARCHAR(MAX), Inserted VARCHAR(MAX));
-- Set has results to false SELECT @hasDataToLoad = 0
PRINT 'Starting Cursor for JSON Inserts'
DECLARE file_cursor CURSOR FOR SELECT lakeFileName FROM OPENJSON(@fileList) WITH ( lakeFileName VARCHAR(250) '$' );
OPEN file_cursor;
FETCH NEXT FROM file_cursor INTO @fileName;
WHILE @@FETCH_STATUS = 0 BEGIN
PRINT @fileName
SET @BulkInsSQL = N' INSERT INTO #Json SELECT BulkColumn as jsonData FROM OPENROWSET (BULK ''' + @fileName + ''', DATA_SOURCE = ''ionis_lake'', SINGLE_CLOB ) AS json ';
PRINT @BulkInsSQL
BEGIN TRY EXECUTE (@BulkInsSQL);
-- Set has results to true if there are no errors SELECT @hasDataToLoad = @hasDataToLoad + 1 INSERT INTO #LegalSummaryOfChanges VALUES ('Insert JSON', 'File ', 'Inserted', @fileName)
END TRY BEGIN CATCH SELECT ERROR_MESSAGE() AS [Error Message] ,ERROR_LINE() AS ErrorLine ,ERROR_NUMBER() AS [Error Number] ,ERROR_SEVERITY() AS [Error Severity] ,ERROR_STATE() AS [Error State]
INSERT INTO #LegalSummaryOfChanges VALUES ('Insert JSON Error', ERROR_MESSAGE(), ' Error Number: ' + CAST(ERROR_NUMBER() as varchar(100)), @fileName) END CATCH
FETCH NEXT FROM file_cursor INTO @fileName; END;
CLOSE file_cursor;
DEALLOCATE file_cursor;
IF @hasDataToLoad > 0 BEGIN
PRINT 'Starting Merge' INSERT INTO #LegalSummaryOfChanges VALUES ('Starting Merge', ' with ', @hasDataToLoad, ' file(s)')
PRINT 'Starting Merge for all tables related to Legal Organisation' -- Merge json contract company data into LegalOrganization table
-- First select the legal org data into a separate temp table to allow us to create a uniqe set -- as the same company will appear in multiple contract records CREATE TABLE #LegalOrganization( [CongaCompanyID] [varchar](100) NULL, [OrganizationName] [varchar](200) NULL, [OrganizationNumber] [varchar](100) NULL, [CompanyGroup] [varchar](200) NULL, [DunsNumber] [varchar](100) NULL, [OrganizationType] [varchar](100) NULL, [OrganizationCategory] [varchar](100) NULL, [OrganizationStatus] [varchar](100) NULL, [StreetAddress1] [varchar](2000) NULL, [StreetAddress2] [varchar](2000) NULL, [City] [varchar](2000) NULL, [StateProvince] [varchar](2000) NULL, [Country] [varchar](2000) NULL, [PostalCode] [varchar](2000) NULL, [ID] [int] IDENTITY(1,1) NOT NULL )
INSERT INTO #LegalOrganization( CongaCompanyID, OrganizationName, OrganizationNumber, CompanyGroup, DunsNumber, OrganizationType, OrganizationCategory, OrganizationStatus, StreetAddress1, StreetAddress2, City, StateProvince, Country, PostalCode ) SELECT JSON_VALUE(j.jsonData, '$.company.id') AS id, JSON_VALUE(j.jsonData, '$.company.name') AS name, JSON_VALUE(j.jsonData, '$.company.number') AS number, JSON_VALUE(j.jsonData, '$.company.group') AS companyGroup, JSON_VALUE(j.jsonData, '$.company.externalId') AS externalId, JSON_VALUE(j.jsonData, '$.company.type') AS type, JSON_VALUE(j.jsonData, '$.company.category') AS category, JSON_VALUE(j.jsonData, '$.company.status') AS status, JSON_VALUE(j.jsonData, '$.company.address1') AS address1, JSON_VALUE(j.jsonData, '$.company.address2') AS address2, JSON_VALUE(j.jsonData, '$.company.city') AS city, JSON_VALUE(j.jsonData, '$.company.stateOfIncorporation') AS stateOfIncorporation, JSON_VALUE(j.jsonData, '$.company.country') AS country, JSON_VALUE(j.jsonData, '$.company.postalCode') AS postalCode FROM #Json j
PRINT 'Starting To Create Unique Legal Organisation List'
-- The same company will appear in multiple contract records -- To get a unique set we need to do a trick using the MAX identity -- from the temp table to only get one of the companies. -- A separate process will keep the companies up to date
CREATE TABLE #UniqueLegalOrganization( [CongaCompanyID] [varchar](100) NULL, [OrganizationName] [varchar](200) NULL, [OrganizationNumber] [varchar](100) NULL, [CompanyGroup] [varchar](200) NULL, [DunsNumber] [varchar](100) NULL, [OrganizationType] [varchar](100) NULL, [OrganizationCategory] [varchar](100) NULL, [OrganizationStatus] [varchar](100) NULL, [StreetAddress1] [varchar](2000) NULL, [StreetAddress2] [varchar](2000) NULL, [City] [varchar](2000) NULL, [StateProvince] [varchar](2000) NULL, [Country] [varchar](2000) NULL, [PostalCode] [varchar](2000) NULL, [ID] [int] IDENTITY(1,1) NOT NULL )
INSERT INTO #UniqueLegalOrganization( CongaCompanyID, OrganizationName, OrganizationNumber, CompanyGroup, DunsNumber, OrganizationType, OrganizationCategory, OrganizationStatus, StreetAddress1, StreetAddress2, City, StateProvince, Country, PostalCode) SELECT main.CongaCompanyID, main.OrganizationName, main.OrganizationNumber, main.CompanyGroup, main.DunsNumber, main.OrganizationType, main.OrganizationCategory, main.OrganizationStatus, main.StreetAddress1, main.StreetAddress2, main.City, main.StateProvince, main.Country, main.PostalCode FROM #LegalOrganization main JOIN ( SELECT MAX(ID) as ID, [CongaCompanyId] FROM #LegalOrganization GROUP BY CongaCompanyId ) sub ON sub.ID = main.ID
PRINT 'Starting Merge for Legal Organisation' -- Merge json contract company data into LegalOrganization table MERGE [legal].[LegalOrganization] AS [Target] USING ( SELECT CongaCompanyID, OrganizationName, OrganizationNumber, CompanyGroup, DunsNumber, OrganizationType, OrganizationCategory, OrganizationStatus FROM #UniqueLegalOrganization ) AS [Source] ON [Target].CongaCompanyID = [Source].CongaCompanyID WHEN MATCHED THEN UPDATE SET [Target].CongaCompanyID = [Source].CongaCompanyID, [Target].OrganizationName = [Source].OrganizationName, [Target].OrganizationNumber = [Source].OrganizationNumber, [Target].CompanyGroup = [Source].CompanyGroup, [Target].DunsNumber = [Source].DunsNumber, [Target].OrganizationType = [Source].OrganizationType, [Target].OrganizationCategory = [Source].OrganizationCategory, [Target].OrganizationStatus = [Source].OrganizationStatus WHEN NOT MATCHED THEN INSERT ( CongaCompanyID, OrganizationName, OrganizationNumber, CompanyGroup, DunsNumber, OrganizationType, OrganizationCategory, OrganizationStatus ) VALUES ( [Source].CongaCompanyID, [Source].OrganizationName, [Source].OrganizationNumber, [Source].CompanyGroup, [Source].DunsNumber, [Source].OrganizationType, [Source].OrganizationCategory, [Source].OrganizationStatus ) OUTPUT 'LegalOrganization', CONVERT(varchar, DELETED.CongaCompanyID), $action, CONVERT(varchar, INSERTED.CongaCompanyID) INTO #LegalSummaryOfChanges;
PRINT 'Starting Merge for Organization' -- Merge json contract company data into [shared].[Organization] table -- Only need to add to join table if doesnt exist -- Eventually, this needs to be managed via an MDM process MERGE [shared].[Organization] AS [Target] USING ( SELECT ulo.OrganizationName, lo.LegalOrganizationID, org.OrganizationId FROM #UniqueLegalOrganization ulo LEFT JOIN [legal].[LegalOrganization] lo ON lo.CongaCompanyID = ulo.CongaCompanyID LEFT JOIN shared.Organization org ON lo.LegalOrganizationID = org.LegalOrganizationID ) AS [Source] ON [Target].LegalOrganizationID = [Source].LegalOrganizationID WHEN NOT MATCHED THEN INSERT ( OrgName, LegalOrganizationID ) VALUES ( [Source].OrganizationName, [Source].LegalOrganizationID ) OUTPUT 'Organization', '', $action, CONVERT(varchar, INSERTED.OrgName) INTO #LegalSummaryOfChanges;
PRINT 'Starting Merge for LocationInfo' -- Merge json contract company data into [shared].[LocationInfo] table -- Only need to add to join table if doesnt exist MERGE [shared].[LocationInfo] AS [Target] USING ( SELECT lo.LegalOrganizationID, li.LocationInfoId, org.OrganizationId FROM #UniqueLegalOrganization ulo LEFT JOIN [legal].[LegalOrganization] lo ON lo.CongaCompanyID = ulo.CongaCompanyID LEFT JOIN shared.Organization org ON lo.LegalOrganizationID = org.LegalOrganizationID LEFT JOIN shared.LocationInfo li ON li.OrganizationID = org.OrganizationID ) AS [Source] ON [Target].LocationInfoId = [Source].LocationInfoId WHEN NOT MATCHED THEN INSERT ( LocationType, OrganizationID ) VALUES ( 'Legal Address', [Source].OrganizationID ) OUTPUT 'LocationInfo', '', $action, CONVERT(varchar, INSERTED.OrganizationID) INTO #LegalSummaryOfChanges;
PRINT 'Starting Merge for Address' -- Merge json contract company data into [shared].[Address] table MERGE [shared].[Address] AS [Target] USING ( SELECT ulo.CongaCompanyID, ulo.OrganizationName, ulo.StreetAddress1, ulo.StreetAddress2, ulo.City, ulo.StateProvince, ulo.Country, ulo.PostalCode, li.LocationInfoId FROM #UniqueLegalOrganization ulo LEFT JOIN [legal].[LegalOrganization] lo ON lo.CongaCompanyID = ulo.CongaCompanyID LEFT JOIN shared.Organization org ON lo.LegalOrganizationID = org.LegalOrganizationID LEFT JOIN shared.LocationInfo li ON li.OrganizationID = org.OrganizationID ) AS [Source] ON [Target].LocationInfoId = [Source].LocationInfoId WHEN MATCHED THEN UPDATE SET [Target].AddresseeName = [Source].OrganizationName, [Target].StreetAddress1 = [Source].StreetAddress1, [Target].StreetAddress2 = [Source].StreetAddress2, [Target].City = [Source].City, [Target].Country = [Source].Country, [Target].PostalCode = [Source].PostalCode, [Target].LocationInfoId = [Source].LocationInfoId WHEN NOT MATCHED THEN INSERT ( AddresseeName, StreetAddress1, StreetAddress2, City, StateProvince, Country, PostalCode, LocationInfoID ) VALUES ( [Source].OrganizationName, [Source].StreetAddress1, [Source].StreetAddress2, [Source].City, [Source].StateProvince, [Source].Country, [Source].PostalCode, [Source].LocationInfoId ) OUTPUT 'Address', CONVERT(varchar, DELETED.AddresseeName), $action, CONVERT(varchar, INSERTED.AddresseeName) INTO #LegalSummaryOfChanges;
PRINT 'Starting Merge for Legal Contracts' -- Merge json contract data into Legal Contracts table MERGE [legal].[LegalContracts] AS [Target] USING ( SELECT JSON_VALUE(j.jsonData, '$.id') AS id, JSON_VALUE(j.jsonData, '$.group') AS contractGroup, JSON_VALUE(j.jsonData, '$.number') AS contractNumber, JSON_VALUE(j.jsonData, '$.agreementType') AS agreementType, JSON_VALUE(j.jsonData, '$.purpose') AS purpose, JSON_VALUE(j.jsonData, '$.legalEntity') AS legalEntity, JSON_VALUE(j.jsonData, '$.effectiveDate') AS effectiveDate, JSON_VALUE(j.jsonData, '$.noticePeriod') AS noticePeriod, JSON_VALUE(j.jsonData, '$.termType') AS termType, JSON_VALUE(j.jsonData, '$.status') AS contractStatus, JSON_VALUE(j.jsonData, '$.currency') AS currency, JSON_VALUE(j.jsonData, '$.originalCompany') AS originalCompany, JSON_VALUE(j.jsonData, '$.description') AS contracDescription, JSON_VALUE(j.jsonData, '$.studyNumber') AS studyNumber, JSON_VALUE(j.jsonData, '$.noticeDate') AS noticeDate, JSON_VALUE(j.jsonData, '$.originalExpirationDate') AS originalExpirationDate, JSON_VALUE(j.jsonData, '$.currentExpirationDate') AS currentExpirationDate, JSON_VALUE(j.jsonData, '$.parentContractId') AS parentContractId, JSON_VALUE(j.jsonData, '$.lastUpdateDate') AS lastUpdateDate, lo.LegalOrganizationID as LegalOrganizationID, lcp.LegalContractsId as ParentLegalContractsId FROM #Json j LEFT JOIN [legal].[LegalOrganization] lo ON JSON_VALUE(j.jsonData, '$.company.id') = lo.CongaCompanyID LEFT JOIN [legal].[LegalContracts] lcp ON JSON_VALUE(j.jsonData, '$.parentContractId') = lcp.CongaContractID ) AS [Source] ON [Target].CongaContractID = [Source].id WHEN MATCHED THEN UPDATE SET [Target].CongaContractID = [Source].id, [Target].ContractNumber = [Source].contractNumber, [Target].AgreementType = [Source].agreementType, [Target].Purpose = [Source].purpose, [Target].LegalEntity = [Source].legalEntity, [Target].OriginalExpirationDate = [Source].originalExpirationDate, [Target].EffectiveDate = [Source].effectiveDate, [Target].CurrentExpirationDate = [Source].currentExpirationDate, [Target].TermType = [Source].termType, [Target].Status = [Source].contractStatus, [Target].Description = [Source].contracDescription, [Target].LastUpdateDate = [Source].lastUpdateDate, [Target].LegalOrganizationID = [Source].LegalOrganizationID, [Target].ParentContractID = [Source].ParentLegalContractsId, [Target].ContractGroup = [Source].ContractGroup, [Target].NoticePeriod = [Source].NoticePeriod, [Target].NoticeDate = [Source].NoticeDate, [Target].StudyNumber = [Source].StudyNumber WHEN NOT MATCHED THEN INSERT ( CongaContractID, ContractNumber, AgreementType, Purpose, LegalEntity, OriginalExpirationDate, EffectiveDate, CurrentExpirationDate, TermType, Status, Description, LastUpdateDate, LegalOrganizationID, ParentContractID, ContractGroup, NoticePeriod, NoticeDate, StudyNumber) VALUES ( [Source].id, [Source].contractNumber, [Source].agreementType, [Source].purpose, [Source].legalEntity, [Source].originalExpirationDate, [Source].effectiveDate, [Source].currentExpirationDate, [Source].termType, [Source].contractStatus, [Source].contracDescription, [Source].lastUpdateDate, [Source].LegalOrganizationID, [Source].ParentLegalContractsId, [Source].ContractGroup, [Source].NoticePeriod, [Source].NoticeDate, [Source].StudyNumber ) OUTPUT 'LegalContracts', CONVERT(varchar, DELETED.CongaContractID), $action, CONVERT(varchar, INSERTED.CongaContractID) INTO #LegalSummaryOfChanges;
PRINT 'Starting Merge for Legal Target' -- Merge contract targets. As this is an array, we assume the new list is correct every time -- so we delete rows that arent in the list from the DB MERGE [legal].[ContractTarget] AS [Target] USING ( SELECT ct.LegalContractsID as LegalContractsID, JSON_VALUE(j.jsonData, '$.id') AS id, case when t.isEncumbered = 'Yes' then 1 else 0 end as IsEncumbred, t.mtid as mtid, t.geneName FROM #Json j JOIN [legal].[LegalContracts] ct ON JSON_VALUE(j.jsonData, '$.id') = ct.CongaContractID CROSS APPLY OPENJSON(j.jsonData, '$.targets') WITH ( mtid varchar(100), geneName varchar(100), isEncumbered varchar(100)) as t --WHERE t.mtid IS NOT NULL ) AS [Source] ON [Target].LegalContractsID = [Source].LegalContractsID AND [Target].MTID = [Source].mtid -- On match, the only field we can update is a possible encomberance change WHEN MATCHED THEN UPDATE SET [Target].IsEncumbred = [Source].IsEncumbred -- When the record is not in the target (byt contract id and mtid) then add WHEN NOT MATCHED BY Target THEN INSERT (LegalContractsID, MTID, IsEncumbred) VALUES ([Source].LegalContractsID, [Source].mtid, [Source].IsEncumbred) -- If there is a record in the source that is not in the target then we need to remove as a record may have been removed from the list WHEN NOT MATCHED BY Source THEN DELETE OUTPUT 'ContractTarget', CONVERT(varchar, DELETED.LegalContractsID), $action, CONVERT(varchar, INSERTED.LegalContractsID) INTO #LegalSummaryOfChanges;
PRINT 'Starting Merge for Legal ContractTypes' -- Merge contract contract types. This is additive as it's difficult to work out if there is a modify. MERGE [legal].[ContractTypes] AS [Target] USING ( -- Using 'value' here as array is of strings, not objects SELECT JSON_VALUE(j.jsonData, '$.id') AS id, value as contractType FROM #Json j CROSS APPLY OPENJSON(j.jsonData, '$.types') ) AS [Source] ON [Target].ContractType = [Source].contractType -- When the record is not in the target then add WHEN NOT MATCHED BY Target THEN INSERT (ContractType) VALUES ([Source].contractType) OUTPUT 'ContractTypes', CONVERT(varchar, DELETED.ContractType), $action, CONVERT(varchar, INSERTED.ContractType) INTO #LegalSummaryOfChanges;
PRINT 'Starting Merge for Legal ContractContractTypes' -- Merge contract types. As this is an array, we assume the new list is correct every time -- so we delete rows that arent in the list from the DB MERGE [legal].[ContractContractTypes] AS [Target] USING ( -- Using 'value' here as array is of strings, not objects SELECT lc.LegalContractsID as LegalContractsID, JSON_VALUE(j.jsonData, '$.id') AS id, value as contractType FROM #Json j JOIN [legal].[LegalContracts] lc ON JSON_VALUE(j.jsonData, '$.id') = lc.CongaContractID CROSS APPLY OPENJSON(j.jsonData, '$.types') ) AS [Source] ON [Target].LegalContractsID = [Source].LegalContractsID AND [Target].ContractTypesID = (SELECT TOP (1) ContractTypesID FROM [legal].[ContractTypes] WHERE contractType = [Source].contractType ) -- When the record is not in the target then add WHEN NOT MATCHED BY Target THEN INSERT (LegalContractsID, ContractTypesID) VALUES ([Source].LegalContractsID, (SELECT TOP (1) ContractTypesID FROM [legal].[ContractTypes] WHERE contractType = [Source].contractType )) -- If there is a record in the source that is not in the target then we need to remove as a record may have been removed from the list WHEN NOT MATCHED BY Source THEN DELETE OUTPUT 'ContractContractTypes', CONVERT(varchar, DELETED.LegalContractsID), $action, CONVERT(varchar, INSERTED.LegalContractsID) INTO #LegalSummaryOfChanges;
PRINT 'End Merge' INSERT INTO #LegalSummaryOfChanges VALUES ('Merge Complete', ' of ', @hasDataToLoad, ' files') END
END TRY BEGIN CATCH
PRINT 'Error Number: ' + CAST(ERROR_NUMBER() as varchar(100))
INSERT INTO #LegalSummaryOfChanges VALUES ('Update Legal Tables Error ', ERROR_MESSAGE(), ' Error Number: ' + CAST(ERROR_NUMBER() as varchar(100)), 'Error ErrorLine: ' + CAST(ERROR_LINE() as varchar(100)))
END CATCH
-- Return a summary of changes as a result set SELECT TableName, Deleted, ActionType, Inserted FROM #LegalSummaryOfChanges;
END;

/* -- ************************************* -- Look up the (most) primary gene term for a given compound number. Used by Pubs application with user 'api_login_restricted' -- Progressive searches from most restrictive to least restrictive. -- See also: -- Author: John O'Neill -- Modified: 03/10/2020. Added EnsemblID alternate search term -- ************************************* */ BEGIN
DECLARE @primaryGene Varchar(50) -- Ensure input parameter is not empty IF @compoundNumber = '' RETURN '' ELSE BEGIN -- Most restrictive filter. Human, status is primary, target type is intended SET @primaryGene = ( SELECT TOP 1 GeneTerm FROM research.CompoundGeneTerms WHERE ( (CompoundNumber= @compoundNumber AND CompoundTermType = 'aso_number' ) or (CompoundTerm = @compoundNumber AND (CompoundTermType = 'trade' or CompoundTermType = 'internal')) or (EnsemblID = @compoundNumber) ) AND GeneTermStatus = 'primary' AND TargetType = 'intended' AND GeneTermType= 'GeneSymbol' AND (species = 'Human') )
-- If none found for most restrictive, remove human species criteria IF @primaryGene IS NULL SET @primaryGene = ( SELECT TOP 1 GeneTerm--gene_symbol FROM research.CompoundGeneTerms WHERE ( (CompoundNumber= @compoundNumber AND CompoundTermType = 'aso_number' ) or (CompoundTerm = @compoundNumber AND (CompoundTermType = 'trade' or CompoundTermType = 'internal')) or (EnsemblID = @compoundNumber) ) AND GeneTermStatus = 'primary' AND TargetType = 'intended' AND GeneTermType= 'GeneSymbol' -- does not have species = human restriction
) -- If none found for any species, relax the restriction on intended target type IF @primaryGene IS NULL SET @primaryGene = ( SELECT TOP 1 GeneTerm--gene_symbol FROM research.CompoundGeneTerms WHERE ( (CompoundNumber= @compoundNumber AND CompoundTermType = 'aso_number' ) or (CompoundTerm = @compoundNumber AND (CompoundTermType = 'trade' or CompoundTermType = 'internal')) or (EnsemblID = @compoundNumber) ) AND GeneTermStatus = 'primary' AND GeneTermType= 'GeneSymbol' -- does not have TargetType = 'intended' restriction -- does not have species = human restriction )
RETURN @primaryGene END
RETURN '' END

/* -- ************************************* -- Look up the (most) primary gene term for a given search term. Used by Pubs application with user 'api_login_restricted' -- Progressive searches from most restrictive to least restrictive. -- See also: -- Author: John O'Neill -- Modified: 03/05/2021. -- ************************************* */ BEGIN DECLARE @primaryGene Varchar(50) -- Ensure input parameter is not empty IF @searchTerm = '' RETURN '' ELSE BEGIN
-- Most restrictive filter. Human, status is primary, term type is GeneSymbol SET @primaryGene = ( SELECT TOP 1 PrimarySymbol FROM research.GeneTerms WHERE (GeneTerm= @searchTerm OR EnsemblID = @searchTerm) AND GeneTermStatus = 'primary'-- synonym AND GeneTermType= 'GeneSymbol' -- | GeneName AND species = 'Human' )
-- If none found for most restrictive, remove human species criteria IF @primaryGene IS NULL SET @primaryGene = ( SELECT TOP 1 PrimarySymbol FROM research.GeneTerms WHERE (GeneTerm= @searchTerm OR EnsemblID = @searchTerm) AND GeneTermStatus = 'primary'-- synonym AND GeneTermType= 'GeneSymbol' -- | GeneName -- AND species = 'Human' -- does not have species = human restriction
) -- If none found for any species, relax the restriction on intended target type IF @primaryGene IS NULL SET @primaryGene = ( SELECT TOP 1 PrimarySymbol FROM research.GeneTerms WHERE (GeneTerm= @searchTerm OR EnsemblID = @searchTerm) AND GeneTermStatus = 'primary'-- synonym -- AND GeneTermType= 'GeneSymbol' -- | GeneName -- AND species = 'Human' -- does not have species = human restriction )
IF @primaryGene IS NULL SET @primaryGene = ( SELECT TOP 1 PrimarySymbol FROM research.GeneTerms WHERE (GeneTerm= @searchTerm OR EnsemblID = @searchTerm) --AND GeneTermStatus = 'primary'-- synonym -- AND GeneTermType= 'GeneSymbol' -- | GeneName -- AND species = 'Human' -- does not have species = human restriction ) RETURN @primaryGene END
RETURN '' END

CREATE FUNCTION [tm].[fnBiomarkerMilestone]
(
	@MethodValidation varchar(250),
	@MethodDevelopment varchar(250),
	@ReagentProcurement varchar(250),
	@Contract varchar(250),
	@Bidding varchar(250)
)
RETURNS varchar(25)
AS


	Exec [tm].[spPostStgTransform];
	Exec [tm].[spLoadStgResearchData];

	--Load Base tables 
	Exec [TM].[spLoadResearchProject];
	Exec [TM].[spLoadResearchProjectStatus];
	Exec [TM].[spLoadResearchIndications];
	exec [TM].[spLoadResearchProjectResearchIndications];
	Exec [TM].[spLoadIonisResearchTargets];
	Exec [TM].[spLoadResearchProjectMilestones];

RETURN 0

/* ============================================= -- Author: Yassir Elyamani -- Create date: 04/29/2021 -- Description: This proc will load data into spIonisResearchTargets
Change Date Changed by Description 05/10/2021 Yassir E Added logic to update GeneTarget from sharepoint data
-- =============================================*/ CREATE PROCEDURE [TM].[spLoadIonisResearchTargets] AS

BEGIN
Merge tm.ResearchIndications tg using (select Distinct isnull(Indication,'Missing') ResearchIndicationName , SYSTEM_USER as CreatedBy ,GETDATE()as CreatedDate ,SYSTEM_USER as LastModifiedBy ,GETDATE() as LastModifiedDate from [TM].[StgResearchData] ) src on tg.ResearchIndicationName = src.ResearchIndicationName WHEN NOT MATCHED THEN INSERT ( ResearchIndicationName ,CreatedBy ,CreatedDate ,LastModifiedBy ,LastModifiedDate ) VALUES ( src.ResearchIndicationName ,src.CreatedBy ,src.CreatedDate ,src.LastModifiedBy ,src.LastModifiedDate );
END

BEGIN
Merge tm.ResearchProject tg using (select stg.[Target] , isnull(fr.FranchiseId,(Select FranchiseId from tm.Franchise where FranchiseName ='Unknown'))FranchiseId ,stg.Franchise as FranchiseName , SYSTEM_USER as CreatedBy ,GETDATE()as CreatedDate ,SYSTEM_USER as LastModifiedBy ,GETDATE() as LastModifiedDate from [TM].[StgResearchData] stg left join tm.Franchise fr on isnull(stg.[Franchise],'Unkown') = fr.FranchiseName) src on tg.ionisTargetName = src.[Target] and isnull(tg.franchiseId,'') = isnull(src.FranchiseId,'') WHEN NOT MATCHED THEN INSERT ( ionisTargetName ,FranchiseId ,FranchiseName ,CreatedBy ,CreatedDate ,LastModifiedBy ,LastModifiedDate ) VALUES ( src.[Target] , src.FranchiseId ,src.FranchiseName ,src.CreatedBy ,src.CreatedDate ,src.LastModifiedBy ,src.LastModifiedDate );
END

BEGIN
Merge tm.ResearchProjectResearchIndications tg using (select distinct rp.ResearchProjectId,ri.ResearchIndicationId from [TM].[StgResearchData] stg Inner join tm.ResearchProject rp on stg.Target = rp.ionisTargetName and stg.Franchise = rp.FranchiseName Inner join ResearchIndications ri on stg.Indication = ri.ResearchIndicationName ) src on tg.ResearchProjectId = src.ResearchProjectId -- and tg.ResearchIndicationId = src.ResearchIndicationId WHEN MATCHED AND tg.ResearchIndicationId <> src.ResearchIndicationId THEN UPDATE set tg.ResearchIndicationId = src.ResearchIndicationId WHEN NOT MATCHED THEN INSERT ( ResearchProjectId ,ResearchIndicationId) VALUES ( src.ResearchProjectId ,src.ResearchIndicationId );
END
